import React from "react";
import Cookies from "js-cookie";

const Settings = () => {
    return (
        <div className="settings-container">
            <div className="settings-box">
                <p>User Settings</p>
            </div>
        </div>
    );
}

const UserSettings = () => {
    return (
        <div className="settings-container">
            <div className="settings-box">
                <p>User Settings</p>
            </div>
        </div>
    );
}

const ReceiptSettings = () => {
    return (
        <div className="settings-container">
            <div className="settings-box">
                <p>User Settings</p>
            </div>
        </div>
    );
}

export default Settings;
export {UserSettings, ReceiptSettings};
